INSERT INTO `cms_page` VALUES (1,'404 Not Found','1column','Page keywords','Page description','no-route','Whoops, our bad...','<div class=\"not-found-page\">\r\n    <dl>\r\n        <dt class=\"not-found-page_top\">\r\n            <img src=\"{{view url=\'images/404.png\'}}\" alt=\"404-img\">\r\n            <div>\r\n                <strong>Sorry...</strong>\r\n                <span>Its not you. Its us.</span>\r\n            </div>\r\n        </dt>\r\n    </dl>\r\n    <dl class=\"not-found-page_bottom\">\r\n        <dt>The page you are looking for cant be found.</dt>\r\n        <dd><a href=\"{{store url=\"\"}}\">Go Home!</a></dd>\r\n    </dl>\r\n</div>','2017-10-20 23:06:12','2017-10-20 23:06:12',1,0,'','','',NULL,NULL,NULL,''),(2,'Magetique','1column','','','home','','\r\n','2017-10-20 23:06:12','2017-10-20 23:06:12',1,0,'<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->','','',NULL,NULL,NULL,''),(4,'Privacy Policy','1column','','','privacy-policy-cookie-restriction-mode','','<div class=\"change-message\">\r\n    <span>Please replace this text with your Privacy Policy.</span>\r\n</div>\r\n<dl class=\"custom-page privacy-policy-page\">\r\n    <dt class=\"heading-2\">General information</dt>\r\n    <dd>Welcome to our Privacy Policy page! When you use our store services, you trust us with your information. This Privacy Policy is meant to help you understand what data we collect, why we collect it, and what we do with it. When you share information with us, we can make our services even better for you. For instance, we can show you more relevant search results and ads, help you connect with people or to make sharing with others quicker and easier. As you use our services, we want you to be clear how were using information and the ways in which you can protect your privacy. This is important; we hope you will take time to read it carefully. Remember, you can find controls to manage your information and protect your privacy and security. Weve tried to keep it as simple as possible.</dd>\r\n    <dt class=\"heading-2\">Right to access, correct and delete data and to object to data processing</dt>\r\n    <dd>Our customers have the right to access, correct and delete personal data relating to them, and to object to the processing of such data, by addressing a written request, at any time. The Company makes every effort to put in place suitable precautions to safeguard the security and privacy of personal data, and to prevent it from being altered, corrupted, destroyed or accessed by unauthorized third parties. However, the Company does not control each and every risk related to the use of the Internet, and therefore warns the Site users of the potential risks involved in the functioning and use of the Internet. The Site may include links to other web sites or other internet sources. As the Company cannot control these web sites and external sources, the Company cannot be held responsible for the provision or display of these web sites and external sources, and may not be held liable for the content, advertising, products, services or any other material available on or from these web sites or external sources.</dd>\r\n    <dt class=\"heading-2\">Management of personal data</dt>\r\n    <dd>You can view or edit your personal data online for many of our services. You can also make choices about our collection and use of your data. How you can access or control your personal data will depend on which services you use. You can choose whether you wish to receive promotional communications from our store by email, SMS, physical mail, and telephone. If you receive promotional email or SMS messages from us and would like to opt out, you can do so by following the directions in that message. You can also make choices about the receipt of promotional email, telephone calls, and postal mail by visiting and signing into Company Promotional Communications Manager, which allows you to update contact information, manage contact preferences, opt out of email subscriptions, and choose whether to share your contact information with our partners. These choices do not apply to mandatory service communications that are part of certain store services.</dd>\r\n    <dt class=\"heading-2\">Information We Collect</dt>\r\n    <dd>Our store collects data to operate effectively and provide you the best experiences with our services. You provide some of this data directly, such as when you create a personal account. We get some of it by recording how you interact with our services by, for example, using technologies like cookies, and receiving error reports or usage data from software running on your device. We also obtain data from third parties (including other companies). For example, we supplement the data we collect by purchasing demographic data from other companies. We also use services from other companies to help us determine a location based on your IP address in order to customize certain services to your location. The data we collect depends on the services and features you use.</dd>\r\n    <dt class=\"heading-2\">How We Use Your Information</dt>\r\n    <dd>Our store uses the data we collect for three basic purposes: to operate our business and provide (including improving and personalizing) the services we offer, to send communications, including promotional communications, and to display advertising. In carrying out these purposes, we combine data we collect through the various store services you use to give you a more seamless, consistent and personalized experience. However, to enhance privacy, we have built in technological and procedural safeguards designed to prevent certain data combinations. For example, we store data we collect from you when you are unauthenticated (not signed in) separately from any account information that directly identifies you, such as your name, email address or phone number.</dd>\r\n    <dt class=\"heading-2\">Sharing Your Information</dt>\r\n    <dd>We share your personal data with your consent or as necessary to complete any transaction or provide any service you have requested or authorized. For example, we share your content with third parties when you tell us to do so. When you provide payment data to make a purchase, we will share payment data with banks and other entities that process payment transactions or provide other financial services, and for fraud prevention and credit risk reduction. In addition, we share personal data among our controlled affiliates and subsidiaries. We also share personal data with vendors or agents working on our behalf for the purposes described in this statement. For example, companies we\'ve hired to provide customer service support or assist in protecting and securing our systems and services may need access to personal data in order to provide those functions. In such cases, these companies must abide by our data privacy and security requirements and are not allowed to use personal data they receive from us for any other purpose. We may also disclose personal data as part of a corporate transaction such as a merger or sale of assets.</dd>\r\n</dl>','2017-10-20 23:06:13','2017-10-20 23:06:13',1,0,'','','',NULL,NULL,NULL,''),(5,'Customer Service','1column','','','customer-service',' Customer Service','<div class=\"customer-service\">\r\n    <div class=\"text-block customer-service__block\">\r\n        <h3>Delivery</h3>\r\n        <h4>Hello and welcome to the shipping and delivery information page! Here you can get acquainted with useful information on terms \r\nand conditions of our goods delivery</h4>\r\n        <p>You can purchase your items online and pick them up at our street store, or ship them directly to your doorstep. Shipping is free on some orders. We use the best carriers in the business to make sure your order gets to you on time. From the Secure Checkout page you\'ll see your item description, price and delivery timing. Where available, you can also choose a faster delivery method for each item on your order, for an additional fee. Delivery times vary according to your selected delivery address, availability of your items and the time of day you place your order.</p>\r\n    </div>\r\n    <div class=\"table-block  customer-service__block\">\r\n        <h3>Cost</h3>\r\n        <div class=\"table-block_wrapper\">\r\n            <table>\r\n                <thead>\r\n                    <th>Services</th>\r\n                    <th>Locations</th>\r\n                    <th>Delivery Schedule</th>\r\n                    <th>Cost Per Shipment</th>\r\n                </thead>\r\n                <tbody>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail Tracker (Order value $50 or less)</td>\r\n                        <td>All of UK</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$45</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$124</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>Northern Ireland, Eire, Scilly Isles</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$11</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Priority courier pre 12pm Next Working Day</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$89</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$72</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>            \r\n        </div>\r\n    </div>\r\n    <div class=\"text-block  customer-service__block\">\r\n        <h3>Free Delivery</h3>\r\n        <p>Free two-day shipping is available on in-stock items. You can see in your bag if your item is in stock. Free two-day shipping is not available on customized, engraved products, and for certain order types, including orders paid for with financing or by bank transfer. To get free two-day shipping, you will need to place your order by 5pm, Monday to Friday. For instance, if you order your goods before 5:00 pm, Monday to Friday we will deliver them in two business days.</p>\r\n    </div>\r\n    <div class=\"list-block  customer-service__block\">\r\n        <h3>Terms & Conditions</h3>\r\n        <ul class=\"row\">\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Sellers Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyers purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\nvar headertext = [];\r\nvar headers = document.querySelectorAll(\".table-block thead\");\r\nvar tablebody = document.querySelectorAll(\".table-block tbody\");\r\n\r\nfor (var i = 0; i < headers.length; i++) {\r\n    headertext[i]=[];\r\n    for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\r\n      var current = headrow;\r\n      headertext[i].push(current.textContent);\r\n      }\r\n} \r\n\r\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\r\n    for (var i = 0, row; row = tbody.rows[i]; i++) {\r\n      for (var j = 0, col; col = row.cells[j]; j++) {\r\n        col.setAttribute(\"data-th\", headertext[h][j]);\r\n      } \r\n    }\r\n}\r\n</script>','2017-11-25 13:52:19','2017-11-25 13:52:19',1,0,'','','',NULL,NULL,NULL,''),(6,'About Us','1column','','','about-us','About Us','<div class=\"about-us-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2 col-sm-12 \">\r\n       <img src=\"{{media url=&quot;wysiwyg/1.jpg&quot;}}\" alt=\"\" />\r\n        <p>\r\n            If we talk about our founder, Mary Harris, her interest in furniture and everything related to it began in her father\'s local chairs & tables store in Virginia... Starting off as his helper and accountant, she eventually grew fond of the whole thing and began to consider an option of starting her own furniture store in the big city. With her first store in Arlington in 1999, Mary\'s chain began to gradually expand, now consisting of more than 5 furniture stores nationwide... We sell only the best furniture sets and pieces, manufactured in either US, Canada or the UK... All of our range includes only brands with long-lasting reputation, which have been proved as popular among people for years...\r\n        </p>\r\n        <p>\r\n            Ultimate Quality and Comfort <br> When you\'re looking for a sofa or a chair, comfort and durability must come first! With our range of cozy daybeds, recliners and many other pieces we can guarantee that you\'ll find it!\r\n        </p>\r\n        <p>\r\n            Agreeable pricing for a great quality <br> The pricing policy that we have put in place makes affordability a centre point... While for some people quality means sky-high cost, for us the balance between these two is reached easily.\r\n        </p>     \r\n    </div>\r\n</div>','2017-11-25 13:53:02','2019-03-25 12:27:30',1,0,'','','',NULL,NULL,NULL,''),(7,'Shipping & Delivery','1column','','','shipping-delivery','Shipping & Delivery','<div class=\"shipping-delivery-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <p>\r\n            So youve done your shopping; just how long will it be till you can rock that swanky new Axolotl-themed laptop skin? The calculator below will give you the average amount of days it takes to ship a product to your door and the best time to contact our support team. Please note that every order at Redbubble is custom printed just for you, and will take 1-3 business days to print prior to shipping.\r\n        </p>\r\n        <span class=\"heading-3\">Here are a few things to consider while you wait for your order:</span>\r\n        <ul>\r\n            <li><span>We ship in business days. Monday - Friday, excluding national holidays.</span></li>\r\n            <li><span>Shipping starts from the date you received the Your Order Has Shipped! email.</span></li>\r\n            <li><span>The estimate above does not include manufacturing time - we need 1-3 business days to make sure your custom order is everything you hoped it would be.</span></li>\r\n        </ul>\r\n        <p>\r\n            Redbubble is a global company - we work with production and shipping partners all over the world to get your things to your doorstep, wherever that may be. Although the vast majority of our customers will get their orders by the day listed above, actual timeframes may vary from region to region.\r\n        </p>\r\n        <div class=\"shipping-delivery-page__border\">\r\n            <span class=\"heading-3\">So when do you contact Redbubble?</span>\r\n            <span>The calculator above lets you know the best time to message us. When that day rolls around.</span>\r\n            <span>Even if your order hasnt arrived by the listed date, its probably still on its way (and worth the wait).</span>\r\n        </div>\r\n        <ol class=\"shipping-delivery-page__list\">\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_shipping-icon\">How much is shipping?</span>\r\n                <p>Once youve clicked through to Secure Checkout, you can enter your delivery address and choose a shipping method. Shipping costs are then calculated and tacked on to your subtotal at the bottom of the page.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_track-icon\">Can I track my order?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_order-icon\">Where does my order ship from?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n        </ol>\r\n    </div>\r\n</div>','2017-11-25 13:53:09','2017-11-25 13:53:09',1,0,'','','',NULL,NULL,NULL,''),(9,'FAQ','1column','','','faq','FAQ','<div class=\"faq-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div id=\"faq-accordion\">\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Is it necessary for me to register an account in order to buy an item?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Which shipping providers do you use?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>How long it will take to receive the furniture?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>How long it will take to receive the furniture?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Do you offer any kind of discounts?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Do you accept orders from all 50 US states?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2017-11-25 13:55:09','2017-11-25 13:55:09',1,0,'','','',NULL,NULL,NULL,''),(10,'Support','1column','','','support','Support','<div class=\"support-page\">\r\n    <div>\r\n        <div class=\"text-block\">\r\n            <p>Our customer support department is ready to come to your aid in a 24/7 manner, be your request in a form on email ticket or a phone call... We have a team of professional managers who will consult you regarding any technical, in-stock or billing question you might have. Also, should there be any problems with the delivery or if you would want to file a return, we will help you as well!</p>\r\n        </div>\r\n        <div class=\"boxes-block\">\r\n            <h3>Have a Question?</h3>\r\n            <ul class=\"row\">\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__archive-icon\">Knowledge Base</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__bubbles-icon\">Community Forum</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__bubble-question-icon\">24/7Ticket Support</span>\r\n                </div></a></li>\r\n                <li class=\"col-md-6\"><a href=\"#\"><div>\r\n                    <span class=\"support-page__envelope-icon\">Contact us</span>\r\n                </div></a></li>\r\n            </ul>\r\n        </div>        \r\n    </div>\r\n</div>\r\n','2017-11-25 13:55:27','2019-03-25 12:23:52',1,0,'','','',NULL,NULL,NULL,''),(11,'Guarantee','1column','','','guarantee','Guarantee & After-Sales Service','<div class=\"guarantee-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div class=\"text-block\">\r\n            <p>Quite often, even after weve chosen an item and purchased it successfully, there may be some things we might want to change or repair afterward - either during or following the delivery process, when filing a return or applying for using our warranty. Here we\'ll try to explain in plain terms how does our stores warranty policy works and how you can be using it when shopping with us!</p>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>What Products are Provided with the Warranty?</h3>\r\n            <p>Some of our furniture items apply for an almost unconditional Lifetime Warranty. The items included in this policy are sofas, couches, love seats, upholstered chairs, ottomans, sectionals, and sleepers. As a retailer we warrant these components to you, the original retail purchaser, to be free from material manufacturing defects. The lifetime duration of the Warranty means the standardized usage cycle for a specific furniture item.</p>\r\n            <ul>\r\n                <li>\r\n                    <h4>Repair & Refurbishing</h4>\r\n                    <span>Our store will pay, within one year from the date of purchase, reasonable and conditional labor rates for refurbishing or replacing the defective parts and shipping costs.</span>\r\n                </li>\r\n                <li>\r\n                    <h4>Different Types of Warranty</h4>\r\n                    <span>While for some items we have a lifetime warranty, the springs in all of our items are offered with a 5 Year Limited type of a Warranty.</span>\r\n                </li>\r\n                <li>\r\n                    <h4>Warranty Exceptions</h4>\r\n                    <span>All seat cushion cores have a natural tendency to become softer during a normal usage cycle, and will conform to the shape of the user. A Limited 1 Year Warranty applies.</span>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>Where to Apply for Warranty Services?</h3>\r\n            <p>Under these Limited Warranties, all of the legal liability of our store is limited to repair, or  if required (or requested by the customer), replacement. We are  ready to pay, within one year from the date of purchase, reasonable and customary labor rates to repair or replace the defective parts and shipping costs from the retailer...</p>\r\n            <p>These Limited Warranties are not applicable for any of our products which ave been altered by any person, dealer, or company without the express written authorization of our store. PLease note, that some States Do Not Allow Limitations On How Long An Implied Warranty Lasts, So The Above Limitations May Not Apply To You.</p>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>In What Cases the Warranty is Not Provided?</h3>\r\n            <p>There can be two limits for the Warranties issued with the purchase of the furniture items on our website.</p>\r\n            <ul class=\"row\">\r\n                <li class=\"col-md-6\">\r\n                    <h4>1, 3 & 5 Years Limited Warranty</h4>\r\n                    <span>The first one is the Warranty time frame, if it is limited to 1, 3 or 5 years. Hence the Lifetime Warranty is not time-restricted.</span>\r\n                </li>\r\n                <li class=\"col-md-6\">\r\n                    <h4>Regular Usage Check</h4>\r\n                    <span>The second one is the examination of the item by our customer support agent, making sure the usage was regular.</span>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"text-block\">\r\n            <h3>Change and Return</h3>\r\n            <p>Filing a change or a return is an easy process, requiring nothing more than your proof of purchase (which usually is the receipt you received), the item itself and the return label printed out by you and put at the top of the package...</p>\r\n        </div>    \r\n    </div>\r\n</div>','2017-11-25 13:55:56','2017-11-25 13:55:56',1,0,'','','',NULL,NULL,NULL,''),(12,'Secure payment','1column','','','secure-payment','Secure payment','<div class=\"secure-payment-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <p>\r\n            When it comes to purchasing something, anything online, the security question towers above everything else. We do not take our stores overall cyber security and particularly the billing process security lightly. We can assure you that all of your shopping here will be a fun and safe experience, enhanced by the all of the factors listed below.\r\n        </p>\r\n        <ul>\r\n            <li>\r\n                <h4>SSL Certificate</h4>\r\n                <span>If the website has an SLL certificate, this means that the owners care about your shopping experience being secure, safe and sound and want to make sure that all the data (including financial) that you enter on our website will be securely encrypted!</span>\r\n            </li>\r\n            <li>\r\n                <h4>Multiple Gateways</h4>\r\n                <span>When we were considering which payment gateways to use on our website, the choice narrowed down to 5 most universal ones: Visa; MasterCard; PayPal; Discover; Stripe.</span>\r\n            </li>\r\n            <li>\r\n                <h4>24/7 Customer Support</h4>\r\n                <span>Also, it is comforting to know that should you experience any kind of technical bump in the road during the checkout process, you can always address our customer support department with your billing questions!</span>\r\n            </li>\r\n        </ul>\r\n        <div class=\"secure-payment_icons\">\r\n            <ul>\r\n                <li><a href=\"#\" class=\"fa fa-cc-visa\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-mastercard\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-paypal\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-discover\"></a></li>\r\n                <li><a href=\"#\" class=\"fa fa-cc-stripe\"></a></li>\r\n            </ul>\r\n        </div>\r\n    </div>\r\n</div>','2017-11-25 13:56:34','2017-11-25 13:56:34',1,0,'','','',NULL,NULL,NULL,''),(13,'Terms & Conditions','1column','','','terms-conditions','Terms & Conditions','<div class=\"terms-conditions-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div class=\"text-block\">\r\n            <p>This Policy is projected to all personal information and sensitive personal data or information that is given by or obtained from any person who visits or uses or accesses the website (\"User\"). We reserve the right to modify or review the details of this Policy without prior notice and the revised Policy will be in effect from the day of uploading.  Therefore, Users are requested to periodically visit the website and review the policy.</p>\r\n            <ul>\r\n                <li>\r\n                    <h